//隐藏相同项。必须，不能删除
function syncHidden(event) {
    Array.from(event.target.children).forEach(function (elem) {
        var command = elem.getAttribute('command');
        if (!command) return;
        var original = document.getElementById(command);
        if (!original) {
            elem.hidden = true;
            return;
        };
        elem.hidden = original.hidden;
        elem.collapsed = original.collapsed;
        elem.disabled = original.disabled;
    });
};

function syncHiddenForGroup(target) {
    Array.from(target.children).forEach(function (elem) {
        var command = elem.getAttribute('command');
        if (!command) return;
        var original = document.getElementById(command);
        if (!original) {
            elem.hidden = true;
            return;
        };
        elem.hidden = original.hidden;
        elem.collapsed = original.collapsed;
        elem.disabled = original.disabled;
    });
};

// 复制对象
function cloneObj(o) {
    if (typeof (o) === typeof (1) || typeof ('') === typeof (o) || typeof (o) === typeof (true) ||
        typeof (o) === typeof (undefined)) {
        return o
    }
    if (Array.isArray(o)) {
        let arr = []
        for (let key in o) {
            arr.push(cloneObj(o[key]))
        }
        return arr
    }
    if (typeof (o) === typeof ({})) {
        if (o === null) {
            return o
        }
        let obj = {}
        for (let key in o) {
            obj[key] = cloneObj(o[key])
        }
        return obj
    }
    return o;
}